  const [selected, setSelected] = useState(0)
  return (
    <Tabs
      items={['Opportunities', 'My Deposits']}
      selected={selected}
      onChange={setSelected}
      placeholder="Select One" // Todo: Change this
    />
  )
}
export default TabComponent
